import React from 'react';
import {useSpring, animated} from 'react-spring'
import logo from './logo.png'
import {Link} from "react-router-dom";

function App() {
    const props = useSpring({
        opacity: 5,
        from: {opacity:0},
        config:{mass:30, tension:1, friction: 50}

    })

    return  ( 
        <div>
             <animated.img className="btn"src={logo} style={props}>
        </animated.img>
        <animated.div style={props} className="viewpoint-header">
                    <Link className="launchTitle" to="./about">|    Flowers     |</Link>
                        <Link className="launchTitle" to="./portfolio">|    Styling     |</Link>

                        <Link className="launchTitle" to="./products">|   Installation  |</Link>
                </animated.div>
        </div>
    )

}

export default App;
